(function () {
    const api = window.SubwayBuilderAPI;
    const LOG = '[FrancePack]';

    if (!api) {
        console.error(LOG, 'SubwayBuilderAPI not found!');
        return;
    }

    const t = api.utils.i18n.create({
        en: {
            par_desc: 'Redesign the Metropolitan in the City of Light.',
            lys_desc: 'Weave your network between the Rhône and Saône.',
            mrs_desc: 'Defy the terrain of the Phocaean City.',
            lil_desc: 'Connect the urban triangle of Lille-Roubaix-Tourcoing.',
            tls_desc: 'Propel the Pink City towards its aerospace hubs.',
            rns_desc: 'Master the flow of the Breton capital.',
            notif: 'Thank you for downloading my map!\n\nIf the map is blank, make sure you have launched run_windows.bat or run_mac-linux.sh (depending on your OS) from the mod folder. Ensure the terminal window remains open in the background, then restart the game.\n\nTo load the map, press Ctrl + Shift + R (Cmd + Option + R on Mac) while on the main menu.\n\nFeel free to report any bugs in the mod\'s post within the #map-sharing forum on the official Subway Builder Discord.\n\nEnjoy!'
        },
        fr: {
            par_desc: 'Réimaginez le Métropolitain dans la Ville Lumière.',
            lys_desc: 'Tissez votre réseau entre Rhône et Saône.',
            mrs_desc: 'Défiez le relief de la Cité Phocéenne.',
            lil_desc: 'Reliez le triangle urbain Lille-Roubaix-Tourcoing.',
            tls_desc: 'Propulsez la Ville Rose vers ses pôles aéronautiques.',
            rns_desc: 'Maîtrisez les flux de la capitale bretonne.',
            notif: 'Merci d\'avoir téléchargé ma carte !\n\nSi rien ne s\'affiche sur la carte, assurez-vous d\'avoir lancé run_windows.bat ou run_mac-linux.sh (selon votre système) dans le dossier du mod. Vérifiez que la fenêtre du terminal reste bien ouverte en arrière-plan, puis redémarrez le jeu.\n\nPour charger la map, utilisez le raccourci Ctrl + Shift + R (Cmd + Option + R sur Mac) depuis le menu principal.\n\nN\'hésitez pas à signaler les bugs sur le post du mod dans le forum #map-sharing du Discord officiel de Subway Builder.\n\nBon jeu !'
        }
    });

    api.registerCity({
        name: 'Paris',
        code: 'PAR',
        description: t('par_desc'),
        population: 4000000,
        initialViewState: {
            zoom: 11.5,
            latitude: 48.8566,
            longitude: 2.3522,
            bearing: 0
        },
        mapImageUrl: 'data:image/png;base64,'
    });

    api.registerCity({
        name: 'Lyon',
        code: 'LYS',
        description: t('lys_desc'),
        population: 1480000,
        initialViewState: {
            zoom: 12,
            latitude: 45.7640,
            longitude: 4.8357,
            bearing: 0
        },
        mapImageUrl: 'data:image/png;base64,'
    });

    api.registerCity({
        name: 'Marseille',
        code: 'MRS',
        description: t('mrs_desc'),
        population: 1700000,
        initialViewState: {
            zoom: 11.8,
            latitude: 43.2965,
            longitude: 5.3698,
            bearing: 0
        },
        mapImageUrl: 'data:image/png;base64,'
    });

    api.registerCity({
        name: 'Lille',
        code: 'LIL',
        description: t('lil_desc'),
        population: 1200000,
        initialViewState: {
            zoom: 11.5,
            latitude: 50.6368,
            longitude: 3.0634,
            bearing: 0
        },
        mapImageUrl: 'data:image/png;base64,'
    });

    api.registerCity({
        name: 'Toulouse',
        code: 'TLS',
        description: t('tls_desc'),
        population: 800000,
        initialViewState: {
            zoom: 12,
            latitude: 43.6045,
            longitude: 1.4442,
            bearing: 0
        },
        mapImageUrl: 'data:image/png;base64,'
    });

    api.registerCity({
        name: 'Rennes',
        code: 'RNS',
        description: t('rns_desc'),
        population: 360000,
        initialViewState: {
            zoom: 12.5,
            latitude: 48.1102,
            longitude: -1.6794,
            bearing: 0
        },
        mapImageUrl: 'data:image/png;base64,'
    });

    const allCities = ['PAR', 'LYS', 'MRS', 'LIL', 'TLS', 'RNS'];

    api.cities.registerTab({
        id: 'france',
        label: '🇫🇷  France',
        cityCodes: allCities
    });

    allCities.forEach(code => {
        api.map.setTileURLOverride({
            cityCode: code,
            tilesUrl: `http://127.0.0.1:8080/${code}/{z}/{x}/{y}.mvt`,
            foundationTilesUrl: `http://127.0.0.1:8080/${code}/{z}/{x}/{y}.mvt`,
            maxZoom: 15
        });

        api.cities.setCityDataFiles(code, {
            buildingsIndex: `/data/${code}/buildings_index.json.gz`,
            demandData: `/data/${code}/demand_data.json.gz`,
            roads: `/data/${code}/roads.geojson.gz`,
            runwaysTaxiways: `/data/${code}/runways_taxiways.geojson.gz`
        });

        api.map.setDefaultLayerVisibility(code, {
            buildingFoundations: false,
            oceanFoundations: false
        });
    });

    api.map.setLayerOverride({
        layerId: 'parks-large',
        sourceLayer: 'landuse',
        filter: ['==', ['get', 'kind'], 'park']
    });

    api.hooks.onCityLoad((cityCode) => {
        if (allCities.includes(cityCode)) {
            api.ui.showNotification(t('notif'), 'info');
        }
    });

    console.log(LOG, 'France Pack loaded successfully!');
})();